# --- Persistens av progresjon (Streamlit Cloud) ---
# Denne l칮sningen bruker Supabase (Postgres) via st.secrets.
# Hvis secrets/avhengighet mangler, faller appen tilbake til vanlig session_state.

@st.cache_resource
def _get_supabase_client():
    if create_client is None:
        return None
    try:
        url = st.secrets.get("SUPABASE_URL")
        key = st.secrets.get("SUPABASE_SERVICE_ROLE_KEY")
    except Exception:
        url, key = None, None
    if not url or not key:
        return None
    try:
        return create_client(url, key)
    except Exception:
        return None


def _sb_enabled() -> bool:
    return _get_supabase_client() is not None


def _serialize_play_progress(play_progress: dict) -> dict:
    # Gj칮r om set() til list() slik at det kan lagres som JSON
    out = {}
    for k, v in (play_progress or {}).items():
        if isinstance(v, dict):
            vv = dict(v)
            comp = vv.get("completed")
            if isinstance(comp, set):
                vv["completed"] = sorted(list(comp))
            out[k] = vv
        else:
            out[k] = v
    return out


def _deserialize_play_progress(saved: dict) -> dict:
    out = {}
    for k, v in (saved or {}).items():
        if isinstance(v, dict):
            vv = dict(v)
            comp = vv.get("completed")
            if isinstance(comp, list):
                vv["completed"] = set(comp)
            out[k] = vv
        else:
            out[k] = v
    return out


def load_progress_from_db(user_id: str) -> dict:
    sb = _get_supabase_client()
    if sb is None or not user_id:
        return {}
    try:
        res = sb.table("progress").select("data").eq("user_id", user_id).limit(1).execute()
        if res and getattr(res, 'data', None):
            row = res.data[0]
            return row.get("data") or {}
    except Exception:
        return {}
    return {}


def save_progress_to_db(user_id: str, data: dict) -> None:
    sb = _get_supabase_client()
    if sb is None or not user_id:
        return
    try:
        sb.table("progress").upsert({"user_id": user_id, "data": data}, on_conflict="user_id").execute()
    except Exception:
        # Ikke knekk appen hvis nett/db feiler
        pass


def list_progress_from_db(limit: int = 300) -> list:
    """Henter progresjon for flere elever (for l칝reroversikt)."""
    sb = _get_supabase_client()
    if sb is None:
        return []
    try:
        res = (
            sb.table("progress")
            .select("user_id,data,updated_at")
            .order("updated_at", desc=True)
            .limit(int(limit))
            .execute()
        )
        return getattr(res, "data", []) or []
    except Exception:
        return []


def reset_progress_in_db(user_id: str) -> None:
    """Nullstiller progresjon for en elev (for l칝rer). Beholder klassekode hvis den finnes."""
    sb = _get_supabase_client()
    if sb is None or not user_id:
        return
    try:
        existing = sb.table("progress").select("data").eq("user_id", user_id).limit(1).execute()
        class_code = ""
        if existing and getattr(existing, "data", None):
            class_code = (existing.data[0].get("data") or {}).get("class_code") or ""
        sb.table("progress").upsert(
            {"user_id": user_id, "data": {"class_code": class_code, "play_progress": {}, "play_state": {}}},
            on_conflict="user_id",
        ).execute()
    except Exception:
        pass



def _summarize_student_row(row: dict) -> dict:
    """Gj칮r Supabase-rad om til en flat oversikt som er lett 친 vise i en tabell."""
    user_id = row.get("user_id", "")
    updated_at = row.get("updated_at", "")
    data = row.get("data") or {}
    pp = _deserialize_play_progress((data.get("play_progress") or {}))

    topics = ["areal", "omkrets", "volum", "m친lestokk", "prosent", "enhetsomregning"]
    unlocked = {}
    completed_total = 0
    for t in topics:
        p = pp.get(t, {}) if isinstance(pp, dict) else {}
        unlocked[t] = int(p.get("unlocked", 1)) if isinstance(p, dict) else 1
        comp = p.get("completed", set()) if isinstance(p, dict) else set()
        if isinstance(comp, list):
            comp = set(comp)
        if isinstance(comp, set):
            completed_total += len(comp)

    return {
        "Elev-ID": user_id,
        "Sist oppdatert": updated_at,
        "Areal (l친st opp)": unlocked.get("areal", 1),
        "Omkrets (l친st opp)": unlocked.get("omkrets", 1),
        "Volum (l친st opp)": unlocked.get("volum", 1),
        "M친lestokk (l친st opp)": unlocked.get("m친lestokk", 1),
        "Prosent (l친st opp)": unlocked.get("prosent", 1),
        "Enhetsomregning (l친st opp)": unlocked.get("enhetsomregning", 1),
        "Fullf칮rte niv친 (sum)": completed_total,
    }


_PLAY_CORRECT_TO_PASS = 3  # antall riktige i hvert niv친 for 친 l친se opp neste


def _pp_key(topic: str) -> str:
    return topic.strip().lower()


def _get_progress(topic: str) -> dict:
    k = _pp_key(topic)
    prog = st.session_state.play_progress.get(k)
    if not prog:
        prog = {"unlocked": 1, "completed": set(), "stars": {}, "correct_counts": {}, "stats": {}}
        st.session_state.play_progress[k] = prog
    if isinstance(prog.get("completed"), list):
        prog["completed"] = set(prog["completed"])
    return prog


def _set_completed(topic: str, level: int):
    prog = _get_progress(topic)
    prog["completed"].add(int(level))
    prog["unlocked"] = max(int(prog.get("unlocked", 1)), int(level) + 1)



def _update_stats(topic: str, level: int, is_correct: bool) -> None:
    """Oppdaterer fors칮k/riktig/feil per tema og niv친 for progresjonsrapport."""
    prog = _get_progress(topic)
    stats = prog.get("stats")
    if not isinstance(stats, dict):
        stats = {}
        prog["stats"] = stats

    lvl = str(int(level))
    row = stats.get(lvl)
    if not isinstance(row, dict):
        row = {"attempts": 0, "correct": 0, "wrong": 0}
        stats[lvl] = row

    row["attempts"] = int(row.get("attempts", 0)) + 1
    if is_correct:
        row["correct"] = int(row.get("correct", 0)) + 1
    else:
        row["wrong"] = int(row.get("wrong", 0)) + 1


def _question_seed(topic: str, level: int, idx: int) -> int:
    # Stabil, men fortsatt "tilfeldig" per bruker칮kt
    base = int(st.session_state.get("_play_seed", 0) or 0)
    if base == 0:
        base = random.randint(10_000, 99_999)
        st.session_state["_play_seed"] = base
    return hash((base, _pp_key(topic), int(level), int(idx))) & 0xFFFFFFFF


def _make_question(topic: str, level: int, q_index: int) -> dict:
    rnd = random.Random(_question_seed(topic, level, q_index))

    # Genererer oppgaver som treffer fanene i appen (Areal/Omkrets/Volum/M친lestokk/Prosent)
    if topic == "Areal":
        if level == 1:
            l = rnd.randint(2, 12)
            w = rnd.randint(2, 10)
            ans = l * w
            return {
                "prompt": f"Finn arealet av et rektangel: lengde {l} m og bredde {w} m. Svar i m.",
                "answer": float(ans),
                "tolerance": 0.01,
                "unit": "m",
                "hint": "Areal = lengde 칑 bredde",
            }
        if level == 2:
            l_cm = rnd.choice([250, 300, 420, 560, 675, 720])
            w_cm = rnd.choice([120, 150, 180, 200, 240, 260])
            l_m = l_cm / 100
            w_m = w_cm / 100
            ans = l_m * w_m
            return {
                "prompt": f"Finn arealet: lengde {l_cm} cm og bredde {w_cm} cm. Konverter til meter f칮rst. Svar i m.",
                "answer": float(ans),
                "tolerance": 0.01,
                "unit": "m",
                "hint": "cm  m: del p친 100. Areal = l 칑 b.",
            }
        # level 3+
        base_area = rnd.choice([12, 18, 24, 30, 36, 42])
        waste = rnd.choice([5, 10, 12, 15])
        ans = base_area * (1 + waste / 100)
        return {
            "prompt": f"Du har et areal p친 {base_area} m og svinn p친 {waste}%. Hva er bestillingsarealet?",
            "answer": float(ans),
            "tolerance": 0.05,
            "unit": "m",
            "hint": "Bestillingsareal = areal 칑 (1 + svinn/100)",
        }

    if topic == "Omkrets":
        if level == 1:
            a = rnd.randint(2, 12)
            b = rnd.randint(2, 10)
            ans = 2 * (a + b)
            return {
                "prompt": f"Finn omkretsen av et rektangel med sider {a} m og {b} m. Svar i meter.",
                "answer": float(ans),
                "tolerance": 0.01,
                "unit": "m",
                "hint": "Omkrets (rektangel) = 2(a + b)",
            }
        if level == 2:
            r = rnd.choice([0.2, 0.25, 0.3, 0.35, 0.4, 0.5])
            ans = 2 * math.pi * r
            return {
                "prompt": f"Finn omkretsen av en sirkel med radius {r} m. Bruk  곋 3,14. Svar i meter.",
                "answer": float(ans),
                "tolerance": 0.05,
                "unit": "m",
                "hint": "Omkrets (sirkel) = 2r",
            }
        # level 3+
        a_cm = rnd.choice([120, 150, 180, 220, 260])
        b_cm = rnd.choice([80, 90, 100, 110, 140])
        ans = 2 * ((a_cm + b_cm) / 100)
        return {
            "prompt": f"Finn omkretsen av et rektangel: {a_cm} cm og {b_cm} cm. Svar i meter.",
            "answer": float(ans),
            "tolerance": 0.02,
            "unit": "m",
            "hint": "Konverter cm  m f칮rst, s친 2(a+b).",
        }

    if topic == "Volum":
        if level == 1:
            l = rnd.randint(2, 8)
            w = rnd.randint(2, 6)
            t_mm = rnd.choice([80, 100, 120, 150, 200])
            ans = l * w * (t_mm / 1000)
            return {
                "prompt": f"Betongplate: {l} m 칑 {w} m med tykkelse {t_mm} mm. Finn volum i m췁.",
                "answer": float(ans),
                "tolerance": 0.02,
                "unit": "m췁",
                "hint": "mm  m: del p친 1000. Volum = l 칑 b 칑 t",
            }
        if level == 2:
            d_mm = rnd.choice([200, 250, 300, 350, 400])
            h = rnd.choice([2.0, 2.4, 2.8, 3.0])
            r = (d_mm / 1000) / 2
            ans = math.pi * (r ** 2) * h
            return {
                "prompt": f"S칮yle (sylinder): diameter {d_mm} mm og h칮yde {h} m. Finn volum i m췁.",
                "answer": float(ans),
                "tolerance": 0.03,
                "unit": "m췁",
                "hint": "Volum sylinder =  r h (r = diameter/2)",
            }
        # level 3+
        l = rnd.randint(8, 25)
        w = rnd.choice([0.3, 0.4, 0.5])
        h_mm = rnd.choice([300, 400, 500, 600])
        ans = l * w * (h_mm / 1000)
        return {
            "prompt": f"Stripefundament: lengde {l} m, bredde {w} m, h칮yde {h_mm} mm. Finn volum i m췁.",
            "answer": float(ans),
            "tolerance": 0.05,
            "unit": "m췁",
            "hint": "Volum = lengde 칑 bredde 칑 h칮yde (mm  m)",
        }

    if topic == "M친lestokk":
        if level == 1:
            drawing_cm = rnd.choice([2.5, 3.0, 4.2, 5.6, 7.5, 10.0])
            n = rnd.choice([20, 25, 50, 75, 100])
            real_cm = drawing_cm * n
            real_m = real_cm / 100
            return {
                "prompt": f"Tegning  virkelighet: {drawing_cm} cm p친 tegning i m친lestokk 1:{n}. Hva er virkelig lengde i meter?",
                "answer": float(real_m),
                "tolerance": 0.02,
                "unit": "m",
                "hint": "Virkelig = tegning 칑 n. Konverter cm  m.",
            }
        if level == 2:
            real_m = rnd.choice([3.6, 4.8, 6.0, 7.2, 9.0])
            n = rnd.choice([20, 25, 50, 75, 100])
            drawing_m = real_m / n
            drawing_mm = drawing_m * 1000
            return {
                "prompt": f"Virkelighet  tegning: {real_m} m i m친lestokk 1:{n}. Hva blir tegningen i mm?",
                "answer": float(drawing_mm),
                "tolerance": 1.0,
                "unit": "mm",
                "hint": "Tegning = virkelighet / n. Konverter m  mm.",
            }
        # level 3+
        drawing_mm = rnd.choice([35, 48, 62, 80, 95, 120])
        n = rnd.choice([10, 20, 25, 50, 75, 100])
        real_mm = drawing_mm * n
        real_m = real_mm / 1000
        return {
            "prompt": f"Tegning  virkelighet: {drawing_mm} mm p친 tegning i m친lestokk 1:{n}. Hva er virkelig lengde i meter?",
            "answer": float(real_m),
            "tolerance": 0.02,
            "unit": "m",
            "hint": "Virkelig (mm) = tegning (mm) 칑 n. Konverter mm  m.",
        }

    if topic == "Prosent":
        if level == 1:
            pct = rnd.choice([5, 10, 12.5, 15, 20, 25])
            base = rnd.choice([240, 360, 480, 800, 1200, 1800])
            ans = base * (pct / 100)
            return {
                "prompt": f"Finn {pct}% av {base}.",
                "answer": float(ans),
                "tolerance": 0.5,
                "unit": "",
                "hint": "Prosent av = tall 칑 (p/100)",
            }
        if level == 2:
            part = rnd.choice([120, 240, 300, 450, 600])
            whole = rnd.choice([800, 1200, 1500, 1800, 2000])
            ans = (part / whole) * 100
            return {
                "prompt": f"Hvor mange prosent er {part} av {whole}? Svar i prosent.",
                "answer": float(ans),
                "tolerance": 0.5,
                "unit": "%",
                "hint": "Prosent = (del/helhet) 칑 100",
            }
        # level 3+
        base = rnd.choice([500, 800, 1200, 1500, 2000])
        rabatt = rnd.choice([10, 15, 20, 25])
        mva = 25
        after = base * (1 - rabatt / 100)
        inc = after * (1 + mva / 100)
        return {
            "prompt": f"En vare koster {base} kr. Du f친r {rabatt}% rabatt og legger p친 {mva}% MVA. Hva blir sluttprisen?",
            "answer": float(inc),
            "tolerance": 2.0,
            "unit": "kr",
            "hint": "F칮rst rabatt, s친 MVA: pris 칑 (1-r/100) 칑 (1+m/100)",
        }


    if topic == "Enhetsomregning":
        # Fokus: mm, cm, m og kontroll av enheter i byggfaglige situasjoner
        if level == 1:
            mm = rnd.choice([50, 75, 120, 148, 200, 450, 600, 1200])
            ans = mm / 1000.0
            return {
                "prompt": f"Gj칮r om {mm} mm til meter. Svar i m.",
                "answer": float(ans),
                "tolerance": 0.001,
                "unit": "m",
                "hint": "mm  m: del p친 1000",
            }
        if level == 2:
            cm = rnd.choice([15, 28, 36, 42, 75, 120, 240])
            mm = rnd.choice([5, 10, 25, 40, 75, 120])
            # total i meter
            ans = (cm / 100.0) + (mm / 1000.0)
            return {
                "prompt": f"Du har {cm} cm og {mm} mm. Hva er total lengde i meter?",
                "answer": float(ans),
                "tolerance": 0.002,
                "unit": "m",
                "hint": "cm  m: /100. mm  m: /1000. Legg sammen.",
            }
        if level == 3:
            # Areal: konverter cm til m f칮r areal
            l_cm = rnd.choice([120, 150, 180, 240, 300, 420])
            w_cm = rnd.choice([60, 80, 90, 100, 120, 150])
            ans = (l_cm/100.0) * (w_cm/100.0)
            return {
                "prompt": f"Et felt er {l_cm} cm 칑 {w_cm} cm. Hva er arealet i m?",
                "answer": float(ans),
                "tolerance": 0.02,
                "unit": "m",
                "hint": "Konverter begge til meter f칮rst, s친 areal = l 칑 b.",
            }
        if level == 4:
            # Volum: tykkelse i mm
            l = rnd.randint(2, 8)
            w = rnd.randint(2, 6)
            t_mm = rnd.choice([50, 80, 100, 120, 150])
            ans = l * w * (t_mm/1000.0)
            return {
                "prompt": f"Betongplate: {l} m 칑 {w} m med tykkelse {t_mm} mm. Hva er volumet i m췁?",
                "answer": float(ans),
                "tolerance": 0.03,
                "unit": "m췁",
                "hint": "Tykkelse i mm m친 til meter (del p친 1000).",
            }
        if level == 5:
            # Feils칮king: enhetskontroll
            # Oppgave: velg riktig  men vi holder oss til tall-svar: hva er riktig meter-verdi
            val = rnd.choice([2.4, 3.6, 4.8, 6.0])
            # presentert feilaktig som cm i stedet for m
            cm = int(val * 100)
            ans = val
            return {
                "prompt": f"En medelev skrev at lengden er {cm} cm, men det skulle st친 i meter. Hva er riktig lengde i meter?",
                "answer": float(ans),
                "tolerance": 0.01,
                "unit": "m",
                "hint": "Sjekk st칮rrelsesorden: {cm} cm = {val} m.",
            }
        # level 6
        a_mm = rnd.choice([3000, 4200, 5600])
        b_m = rnd.choice([1.8, 2.4, 3.0])
        ans = (a_mm/1000.0) + b_m
        return {
            "prompt": f"Kombiner og dokumenter: {a_mm} mm + {b_m} m. Hva er summen i meter?",
            "answer": float(ans),
            "tolerance": 0.01,
            "unit": "m",
            "hint": "Konverter mm  m f칮rst, s친 legg sammen.",
        }

    # fallback
    a = rnd.randint(2, 10)
    b = rnd.randint(2, 10)
    return {
        "prompt": f"Regn ut {a} 칑 {b}.",
        "answer": float(a * b),
        "tolerance": 0.01,
        "unit": "",
        "hint": "Gange",
    }



