def show_result(res: CalcResult):
    mode = st.session_state.get("app_mode", "칒v")
    school = is_school_mode()
    test_mode = is_test_mode()

    col1, col2 = st.columns([1.1, 1])

    with col1:
        st.subheader(tt("Resultat", "Result"))

        # L칝ringshint 칮verst (kun i 칒v/Test)
        if school:
            if test_mode:
                st.info(tt("Test f칮rst: regn selv f칮r du ser mellomregning. Sjekk alltid enheter og rimelighet.",
                           "Try first: calculate yourself before viewing the working. Always check units and reasonableness."))
            else:
                st.info(tt("Tips: Sjekk alltid enhet (mm/cm/m) og om svaret virker realistisk.",
                           "Tip: Always check units (mm/cm/m) and whether the result seems reasonable."))

        # M친lestokk: profesjonell metric-visning for begge retninger
        if res.name.startswith("M친lestokk"):
            o = res.outputs

            if "virkelig_mm" in o:
                c1, c2, c3 = st.columns(3)
                c1.metric("Virkelig m친l (mm)", format_value("virkelig_mm", o.get("virkelig_mm", 0)))
                c2.metric("Virkelig m친l (cm)", format_value("virkelig_cm", o.get("virkelig_cm", 0)))
                c3.metric("Virkelig m친l (m)", format_value("virkelig_m", o.get("virkelig_m", 0)))

            if "tegning_mm" in o:
                c1, c2, c3 = st.columns(3)
                c1.metric("Tegningsm친l (mm)", format_value("tegning_mm", o.get("tegning_mm", 0)))
                c2.metric("Tegningsm친l (cm)", format_value("tegning_cm", o.get("tegning_cm", 0)))
                c3.metric("Tegningsm친l (m)", format_value("tegning_m", o.get("tegning_m", 0)))

        # Kledning: profesjonell metric-visning
        elif res.name.startswith("T칮mmermannskledning"):
            o = res.outputs
            r1c1, r1c2, r1c3 = st.columns(3)
            r1c1.metric("Underliggere", str(o.get("underliggere_antall", "")))
            r1c2.metric("Overliggere", str(o.get("overliggere_antall", "")))
            r1c3.metric("Overligger OK", str(o.get("overligger_ok_for_omlegg", "")))

            r2c1, r2c2, r2c3 = st.columns(3)
            r2c1.metric("Dekket bredde (mm)", format_value("dekket_bredde_mm", o.get("dekket_bredde_mm", 0)))
            r2c2.metric("Overdekning (mm)", format_value("overdekning_mm", o.get("overdekning_mm", 0)))
            r2c3.metric(
                "Min overliggerbredde (mm)",
                format_value("min_overligger_bredde_mm", o.get("min_overligger_bredde_mm", 0)),
            )

        # Standard: labels uten understreker
        else:
            for k, v in res.outputs.items():
                st.write(f"**{label_for(k)}**: {format_value(k, v)}")

        # Varsler: skole vs produksjon
        if res.warnings:
            if school:
                st.warning("Sjekk dette:\n- " + "\n- ".join(res.warnings))
                st.caption("I skolemodus er varsler laget for 친 st칮tte kontroll og enhetsforst친else.")
            else:
                st.error("Kontroller f칮r bruk i produksjon:\n- " + "\n- ".join(res.warnings))
        else:
            st.success("Ingen varsler.")

        # Skolemodus: refleksjon og egenkontroll (checkliste)
        if school:
            with st.container(border=True):
                st.markdown("**" + tt("Egenkontroll f칮r du g친r videre", "Self-check before moving on") + "**")
                c_a, c_b, c_c = st.columns(3)
                with c_a:
                    st.checkbox(tt("Jeg har kontrollert enhetene", "I verified the units"), key=f"chk_units_{res.timestamp}")
                with c_b:
                    st.checkbox(tt("Svaret virker realistisk", "The result seems reasonable"), key=f"chk_real_{res.timestamp}")
                with c_c:
                    st.checkbox(tt("Jeg kan forklare fremgangsm친ten", "I can explain the method"), key=f"chk_explain_{res.timestamp}")
                st.caption(tt(
                    "Tips: Gj칮r en grovsjekk (avrund, sammenlign med erfaring). Typisk feil er mm vs m eller prosent vs desimal.",
                    "Tip: Do a quick sanity check (round, compare with experience). Common errors are mm vs m or percent vs decimal."
                ))

        # Historikk
        if st.button("Lagre i historikk", type="primary"):
            st.session_state.history.append(
                {
                    "tid": res.timestamp,
                    "kalkulator": res.name,
                    "modus": st.session_state.get("app_mode","칒v"),
                    "inputs": res.inputs,
                    "outputs": res.outputs,
                    "warnings": res.warnings,
                }
            )
            st.toast("Lagret.")

    with col2:
        st.subheader(tt("Utregning", "Working"))

        # 칒v: 친pen mellomregning. Test: skjult som standard.
        exp_label = tt("Vis mellomregning", "Show working")
        if test_mode:
            exp_label = tt("Vis fasit / mellomregning", "Reveal working")
        with st.expander(exp_label, expanded=(school and (not test_mode))):
            for s in res.steps:
                st.write(f"- {s}")



